import React from 'react';
import { Router } from '@reach/router';

import Octicon, { Beaker } from '@primer/octicons-react';
import { Navbar, Button, Alignment, Classes, Colors } from '@blueprintjs/core';

import cn from 'classnames';
import { siteWidth } from '../constants';

const DiagonalSeperator = ({ reversed, height, width, colorTop = Colors.BLACK,
    colorBottom = Colors.DARK_GRAY2, className = '', ...props
}) => (
    <div className={cn('separator', className, { reversed })} {...props}>
        <style jsx>{`
            .separator {
                width: 0;
                height: 0;
                border-style: solid;
                border-width: ${height}vh ${width}vw 0 0;
                border-color: ${colorTop} ${colorBottom} ${colorBottom} ${colorBottom};
            }

            .reversed.separator {
                border-width: ${height}vh 0 0 ${width}vw;
            }
        `}</style>
    </div>
);

const Flex = ({ children, className, ...props }) => (
    <div className={cn(className, 'flex')} {...props}>
        {children}
        
        <style jsx>{`
            margin: 0;
            min-width: 0;
            box-sizing: border-box;

            display: flex;
            flex-direction: column;
        `}</style>
    </div>
);

const Container = ({ children, className, ...props }) => (
    <div className={cn(className, 'container')} {...props}>
        {children}
        
        <style jsx>{`
            .container {
                width: 100%;
                margin: 0 auto;
                max-width: ${siteWidth};
            }
        `}</style>
    </div>
);

const Home = () => (<>
    <Flex style={{ height: '100vh' }} className={Classes.DARK}>
        <div style={{ backgroundColor: Colors.BLACK }}>
            <Navbar style={{ backgroundColor: Colors.BLACK }}>
                <Container>
                    <Navbar.Group align={Alignment.LEFT}>
                        <Navbar.Heading>votsec</Navbar.Heading>
                    </Navbar.Group>

                    <Navbar.Group align={Alignment.RIGHT}>
                        <Button minimal icon={<Octicon icon={Beaker} />} />
                    </Navbar.Group>
                </Container>
            </Navbar>

            <Container>
                <h1 className='hero-header'>
                    Vote your <span className='hero-highlight'>mind</span>
                </h1>
            </Container>
        </div>

        <Flex style={{ flexDirection: 'row' }}>
            <DiagonalSeperator width={30} height={10} reversed />
            <DiagonalSeperator width={70} height={10} />
        </Flex>

        <div style={{ flexGrow: '1', backgroundColor: Colors.DARK_GRAY2 }}>

        </div>

        <style jsx>{`
            .hero-header {
                margin: 0;
                font-size: 5em;
                text-align: center;
            }

            .hero-higlight {
                color: ${Colors.VIOLET1};
            }

            @media (min-width: ${siteWidth}) {
                .hero-header {
                    font-size: 7em;
                }
            }
        `}</style>
    </Flex>
</>);

const Lab = () => (
    <p>
        This is the lab
    </p>
);

const App = () => (
    <Router>
        <Home path='/' />
        <Lab path='/lab' />
    </Router>
);

export default App;
